function setAxiosConstants ()  {
  Axios.get(`${process.env.REACT_APP_API_HOST_URL}/api/auth/token`)
      .then((response) => {
        console.log("Setting token ", response.data);
        axios.defaults.headers.common['Cookie'] = "AUTH_TOKEN";

      })
      .catch((error) => {
        console.error(error.message);
      });
  return
}
axios.defaults.withCredentials = true


